		<?php if ( have_posts() ) : ?>
		<?php while ( have_posts() ) : the_post(); ?>
		<div class="sponsor-lead"><?php the_field( 'mashing-up_sponsored--lead_ja' ); ?></div>
		<?php endwhile; ?>
		<?php endif; ?>

		<?php
			$get_sponsors =  get_terms( 'sponsor_type', array(
					'orderby' => 'menu_order'
				));
			if ( $get_sponsors ) :
		?>
		<?php foreach ( $get_sponsors as $get_sponsor ) : ?>
		<?php
			$slug = $get_sponsor->slug;

			$sponsor_item = get_posts(array(
					'post_type' => 'sponsor',
					'posts_per_page' => -1,
					'orderby' => 'menu_order',
					'tax_query' => array(
						array(
							'taxonomy' => 'sponsor_type',
							'field'    => 'slug',
							'terms'    => $slug
						)
					)
				));
			if ( $sponsor_item ) :
		?>
		<h2 class="sponsor-subtitle"><?php echo $get_sponsor->name; ?></h2>
		<?php
			$list_type = get_field( 'mu_sponsor_size', 'sponsor_type_' . $get_sponsor->term_id );
			if ( empty( $list_type ) ) {
				$list_type = 'small';
			}
			$list_type_count = count($sponsor_item);
		?>
		<div class="sponsor-list <?php echo $list_type; ?>">
			<ul<?php if ( $list_type_count === 1 ) { echo ' class="only"'; } ?>>
				<?php foreach ( $sponsor_item as $post ) : setup_postdata( $post ); ?>
				<li>
					<a href="<?php the_field( 'mu_sponsor_link_url' ); ?>" target="_blank" rel="noopener"><?php the_post_thumbnail( 'full' ); ?></a>
				</li>
				<?php endforeach; wp_reset_postdata(); ?>
			</ul>
		</div>
		<?php endif; ?>
		<?php endforeach; ?>
		<?php endif; ?>

	</section>

</div>

